<!--############################# AUXILLARY FUNCTIONS #############################-->

// This function controls the timings on the maps page
function sleep(ms) {
    return new Promise(resolve => setTimeout(resolve, ms))
}

// This function controls how tabs open and close throughout the website
function openTab(idName) {
    var i;
    // Hide all elements with tabififed as the class
    var x = document.getElementsByClassName("tabified");
    for (i = 0; i < x.length; i++) {
        x[i].style.display = "none";
    }
    document.getElementById(idName).style.display = "block";
    if (idName == 'intro'){
        // Hide storyButton and heatmap, show landing page
        document.getElementById('storyButton').style.display = "none";
        document.getElementById('heatmap').style.display = "none";
        document.getElementById(idName).style.display = "block";

    }
    if (idName == 'heatmap'){
        // Hide piebutton and show heat-text and story button
        document.getElementById('piebutton').style.display = "none";
        document.getElementById('heat-text').style.display = "block";
        document.getElementById('heat-text1').style.display = "block";
        document.getElementById('storyButton').style.display = "block";
        getHeat()
        // document.getElementById('storyButton').style.color = "#00BFFF";
    }
    if (idName == 'piediv'){
        // Show pie-text and piebutton
        document.getElementById('pie-text').style.display = "block";
        document.getElementById('piebutton').style.display = "block";
        genPie()
    }

}

// Initiates the animations for the map page
function beginStory(idName) {
    // Hide heatmap and story button
    document.getElementById('heatmap').style.display = "none";
    document.getElementById('storyButton').style.display = "none";
    var i;
    // Hide all elements with 'tabified' as the class
    var x = document.getElementsByClassName("tabified");
    for (i = 0; i < x.length; i++) {
        x[i].style.display = "none";
    }
    // Show map
    document.getElementById(idName).style.display = "block";

    // Begin map animation
    mapAnimation(5000)
}

// Create asynchronous mapAnimation so we can use sleep function effectively
async function mapAnimation(time) {
    // Wait 2 seconds before starting animation
    await sleep(2000);
    // Open Visualisation 1
    activateMap('amcharts-map-image-customer', 'changeColor');
    activateMap('amcharts-map-image-top', 'changeColor');
    document.getElementsByClassName("float-text-map-left")["0"].style.display = "block";
    // Wait specified time
    await sleep(time);
    // Open Visualisation 2
    document.getElementsByClassName("float-text-map-right")["0"].style.display = "block";
    activateMap('amcharts-map-image-top', 'changeColortop');
    // Wait specified time
    await sleep(time);
    // Open Visualisation 3
    document.getElementsByClassName("float-text-map-bottom-right")["0"].style.display = "block";
    activateMap('amcharts-map-image-new', 'changeColornew');
}

// Manipulate Map css to create animation effects
function activateMap(className, animationName) {
    var elems = document.getElementsByClassName(className);
    for (var i=0;i<elems.length;i+=1){
        // Link the map elements to predefined animations (in index.css)
        elems[i].style.animationName = animationName;
    }

}


